import React, { useState, useEffect } from 'react';
import api from '../../services/api';
import { Link, useStory } from 'react-router-dom';
import Input from '../../components/Input';
import Textarea from '../../components/TextArea';
import styles from './styles.css';
import PageHeader from '../../components/PageHeader';

function WorkStationDetail() {
  const [workStation, setWorkStation] = useState({});
  const [schedules, setSchedules] = useState([]);
  const [rooms, setRooms] = useState([]);

  const workStationId = localStorage.getItem('ws_id');
  useEffect(() => {
    api
      .get(`workstation/${workStationId}`, {
        headers: {
          authorization:
            'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6InJhZmFlbGRhbnRhczQ2MUBnbWFpbC5jb20iLCJpYXQiOjE1OTc0MzA2NDQsImV4cCI6MTU5ODAzNTQ0NH0.aPXrSxLf9uQ8x_dQeyyEY0mrmMpyGzU4PYI_bczeJsc',
        },
      })
      .then((response) => {
        setWorkStation(response.data.workstation);
        setSchedules(response.data.schedules);
        setRooms(response.data.rooms);
      });
  }, [workStationId]);
  console.log(workStation);
  console.log(schedules);
  console.log(rooms);
  return (
    <div id="page-wsDetail" className="container">
      <PageHeader title="">
        <Link to="/workstations">WorkStations</Link>
        <Link>Listar Usuários</Link>
        <Link>Editar informações de usuário</Link>
        <main>
          <h1>{workStation.id}</h1>

          <ul>
            {schedules.map((scheduleItem) => {
              return (
                <li key={scheduleItem.id}>
                  <h2>{scheduleItem.week_day}</h2>
                  <h2>{scheduleItem.from}</h2>
                  <h2>{scheduleItem.to}</h2>
                </li>
              );
            })}
          </ul>
        </main>
      </PageHeader>
    </div>
  );
}

export default WorkStationDetail;
